import numpy as np

def submatrix_with_n_numbers(matrix):
    count = 0
    row, col = matrix.shape
    for subRow in range(1,row+1):
        for subCol in range(1,col+1):
            if subRow*subCol == 99:
                count += (row-subRow+1)*(col-subCol+1)
    return count
```
This function takes a two-dimensional numpy matrix as an input, iterates over all possible sizes of submatrices (from 1x1 to the size of the original matrix), checks whether the size of the current submatrix equals to 99, and if it does, increases the counter by the number of such submatrices of the current size in the original matrix. The function then returns the total count of submatrices of size 99.
